def solution(stdin: str) -> str:
    def read_input() -> tuple:
        n, m, D = map(int, stdin.split())
        edges = [list(map(int, stdin.split())) for _ in range(m)]
        return n, m, D, edges

    def find_spanning_tree(edges: List[List[int]], D: int, n: int) -> List[int]:
        def find_parent(parent, i):
            if parent[i] == i:
                return i
            parent[i] = find_parent(parent, parent[i])
            return parent[i]

        def union(parent, rank, i, j):
            pi, pj = find_parent(parent, i), find_parent(parent, j)
            if pi == pj:
                return
            if rank[pi] < rank[pj]:
                parent[pi] = pj
            elif rank[pi] > rank[pj]:
                parent[pj] = pi
            else:
                parent[pj] = pi
                rank[pi] += 1

        n = len(edges)
        parent = [i for i in range(n)]
        rank = [0] * n
        for u, v in edges:
            union(parent, rank, u - 1, v - 1)
        mst_edges = []
        for u, v in edges:
            if find_parent(parent, u - 1) == find_parent(parent, v - 1):
                mst_edges.append((u, v))
        return mst_edges

    n, m, D, edges = read_input()
    if n - 1!= m:
        return "NO"

    mst_edges = find_spanning_tree(edges, D, n)
    if not mst_edges:
        return "NO"

    print("YES")
    for u, v in mst_edges:
