    strings = [list(s) for s in strings]
    order = []

    def backtrack(i, index):
        if i == n:
            if not index:
                order.append(''.join(strings[i]))
            return

        if index == len(strings[i]):
            backtrack(i + 1, 0)
            return

        for j in range(index, len(strings[i])):
            if strings[i][index:j+1] in strings[i][:j] and j > index:
                backtrack(i, j+1)

    backtrack(0, 0)

    if not order:
        return 'NO'

    return 'YES\n' + '\n'.join(order)

