        visited = set()
        queue = [city]
        while queue:
            current = queue.pop(0)
            visited.add(current)
            if current == capital:
                return visited
            for neighbor in cities - visited:
                if (neighbor, current) in roads or (current, neighbor) in roads:
                    queue.append(neighbor)
        return visited

    def reachable_cities(city: int) -> int:
        visited = bfs(city)
        return len(visited)

    min_roads = min(reachable_cities(city) for city in cities)

    return str(min_roads)

