    y = list(map(float, stdin.split()[2:]))
    if points < 3:
        return "0"

    def dist(p1, p2):
        return (p1[0] - p2[0]) ** 2 + (p1[1] - p2[1]) ** 2

    def find_closest(points, x, y):
        closest_point = (x[0], y[0])
        closest_dist = dist(closest_point, (x[0], y[0]))
        for i in range(1, points):
            dist_i = dist(closest_point, (x[i], y[i]))
            if dist_i < closest_dist:
                closest_dist = dist_i
                closest_point = (x[i], y[i])
        return closest_point

    def angle(p1, p2, p3):
        return acos((p1[0] * p2[0] + p1[1] * p2[1] + p3[0] * p3[0] + p3[1] * p3[1]) / (sqrt(p1[0] ** 2 + p1[1] ** 2) * sqrt(p2[0] ** 2 + p2[1] ** 2) * sqrt(p3[0] ** 2 + p3[1] ** 2)))

    def find_angle(points, x, y):
        closest_point = find_closest(points, x, y)
        angles = [angle(closest_point, (x[i], y[i]), (closest_point[0], closest_point[1])) for i in range(points)]
        max_angle = max(angles)
        return max_angle

    def calculate_error(points, x, y):
        closest_point = find_closest(points, x, y)
        angle_diff = abs(find_angle(points, x, y) - find_angle(points, x, closest_point))
        return angle_diff

    theta = calculate_error(points, x, y)
    return f"{theta:.2f}"

