    # Create a 2D list to store the minimum number of operations required to convert each sub-string.
    min_operations = [[0] * (t_length + 1) for _ in range(s_length + 1)]

    # Initialize the first row and column with the length of the shortest sub-string.
    for i in range(1, s_length + 1):
        min_operations[i][0] = i
    for j in range(1, t_length + 1):
        min_operations[0][j] = j

    # Fill the rest of the 2D list using dynamic programming.
    for i in range(1, s_length + 1):
        for j in range(1, t_length + 1):
            if s[i - 1] == t[j - 1]:
                min_operations[i][j] = min_operations[i - 1][j - 1]
            else:
                # Replace the current character in S with the corresponding character in T.
                min_operations[i][j] = min(min_operations[i][j - 1], min_operations[i - 1][j], min_operations[i - 1][j - 1]) + 1

