        if 0 <= i < 4 and 0 <= j < 4 and 0 <= direction < 4:
            return True
        else:
            return False

    def get_neighbors(grid, i, j, direction):
        result = []
        for move in [(i, j, -1), (i, j, 1), (i - 1, j, -1), (i - 1, j, 1), (i + 1, j, -1), (i + 1, j, 1), (i, j - 1, -1), (i, j - 1, 1), (i, j + 1, -1), (i, j + 1, 1)]:
            if move[0] < 0 or move[0] >= 4 or move[1] < 0 or move[1] >= 4 or move[2] < -1 or move[2] > 1:
                continue
            if abs(move[2]) == 1:
                result.append(move)
        return result

    def merge_tiles(grid, i, j):
        for neighbor in get_neighbors(grid, i, j, 0):
            if grid[neighbor[0]][neighbor[1]] == grid[i][j]:
                grid[i][j] *= 2
                grid[neighbor[0]][neighbor[1]] = 0
                return True
        return False

    def move_tiles(grid, i, j, direction):
        for neighbor in get_neighbors(grid, i, j, direction):
            if grid[neighbor[0]][neighbor[1]] == 0:
                grid[neighbor[0]][neighbor[1]] = grid[i][j]
                grid[i][j] = 0
                return True
        return False

    def get_score(grid):
        score = 0
        for row in grid:
            for tile in row:
                if tile == 2048:
                    return 1024
                elif tile >= 2:
                    score += tile
        return score

    def check_game_over(grid):
        for row in grid:
            for tile in row:
                if tile == 0:
                    return False
        return True

    def game_loop(grid):
        direction = move
        i, j = 1, 1
        while not check_game_over(grid):
            if not is_valid_move(grid, (i, j, direction)):
                direction = (direction + 1) % 4

            if merge_tiles(grid, i, j):
                continue

            if move_tiles(grid, i, j, direction):
                break

            i, j = (i + 1) % 4, (j + 1) % 4

        score = get_score(grid)
