def solution(stdin: str) -> str:
    # Read input
    length = int(stdin.split()[0])
    line = stdin.split()[1]

    # Initialize variables
    parentheses_count = 0
    brackets_count = 0
    braces_count = 0
    delimiters = {'(', ')', '[', ']', '{', '}'}
    stack = []
    error_index = None

    # Iterate over the characters in the line
    for index, character in enumerate(line):
        # Check for opening delimiters
        if character in delimiters:
            if character == '(':
                parentheses_count += 1
            elif character == '[':
                brackets_count += 1
            elif character == '{':
                braces_count += 1
            stack.append((character, index))

        # Check for closing delimiters
        if character in delimiters:
            if character == ')':
                parentheses_count -= 1
            elif character == ']':
                brackets_count -= 1
            elif character == '}':
                braces_count -= 1
            if parentheses_count < 0 or brackets_count < 0 or braces_count < 0:
                error_index = index
                break

        # Check for stack overflow
        if parentheses_count < 0 or brackets_count < 0 or braces_count < 0:
            error_index = index
            break

    # Check for stack underflow
    if parentheses_count < 0 or brackets_count < 0 or braces_count < 0:
        error_index = len(line)

    # Print the output
    if error_index is None:
        return 'ok so far'
    return line[stack[error_index][1]:], stack[error_index][1]

