    end_x, end_y = N - 1, M - 1
    directions = {'U': (0, -1), 'D': (0, 1), 'L': (-1, 0), 'R': (1, 0)}

    for x in range(N):
        for y in range(M):
            if grid[x][y] == '1':
                return 'NOT POSSIBLE'

    visited = set()
    queue = [(start_x, start_y, 0)]
    distances = {}
    distances[(start_x, start_y)] = 0

    while queue:
        x, y, distance = queue.pop(0)
        if (x, y) == (end_x, end_y):
            return distance

        if (x, y) in visited:
            continue
        visited.add((x, y))

        for dx, dy in directions.values():
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < M:
                if (nx, ny) not in visited and grid[nx][ny] == '0' and (nx, ny) not in queue:
                    queue.append((nx, ny, distance + 1))

    return 'NOT POSSIBLE'

