        nonlocal max_weight
        if i == n:
            if max_weight <= c:
                memo.add(len(memo))
                max_weight = 0
        else:
            if i > 0 and weights[i] > weights[i - 1]:
                dfs(i + 1, memo)
            if max_weight + weights[i] <= c:
                max_weight += weights[i]
                dfs(i + 1, memo)
                max_weight -= weights[i]

    max_weight = 0
    memo = set()
    dfs(0, memo)
    return str(max(memo))

