def solution(stdin: str) -> str:
    def get_highest_and_lowest(sides: List[int]) -> Tuple[int, int]:
        highest, lowest = sides[0], sides[0]
        for side in sides[1:]:
            if side > highest:
                highest = side
            if side < lowest:
                lowest = side
        return highest, lowest

    def calculate_probability(sides: List[int], highest: int, lowest: int) -> float:
        def get_all_sides(number: int) -> List[int]:
            return [number + side for side in range(1, 5)]

        all_sides = get_all_sides(highest) + get_all_sides(lowest)
        total = len(all_sides)
        return len([side for side in all_sides if side in sides]) / total

    def dice_comparer(a: List[int], b: List[int]) -> str:
        highest_a, lowest_a = get_highest_and_lowest(a)
        highest_b, lowest_b = get_highest_and_lowest(b)

        if highest_a == highest_b and lowest_a == lowest_b:
            return "Tie"

        probability_a = calculate_probability(a, highest_a, lowest_a)
        probability_b = calculate_probability(b, highest_b, lowest_b)

        if probability_a > probability_b:
            return "Emma"
        else:
            return "Gunnar"

    a, b = map(lambda x: list(map(int, x.split())), stdin.splitlines())
    winner = dice_comparer(a, b)
    return winner

