    def dfs(i, j):
        if (i, j) in islands:
            return
        islands.add((i, j))
        dfs(i + 1, j) if i + 1 < rows else None
        dfs(i - 1, j) if i - 1 >= 0 else None
        dfs(i, j + 1) if j + 1 < cols else None
        dfs(i, j - 1) if j - 1 >= 0 else None

    for i in range(rows):
