            if (i, j) in islands:
                continue
            land_count -= 1
            water_count -= 1
            cloud_count -= 1
            dfs(i, j)
            islands_count += 1
            land_count += 1
            water_count += 1
            cloud_count += 1

    return str(islands_count)

